import React from 'react';
import Notification from '@assets/svg/Notification.svg';
import Profile from '@assets/svg/Profile.svg';

export default function index() {
    return (
        <div>
            <div className="absolute top-0 h-20 w-full bg-white rounded-b-full p-3">
                <div className="flex justify-around">
                    <div>
                        <img className="w-12 h-12 " src="/images/logo.png" />
                    </div>
                    <div className="bg-gray-300 h-6 w-52 rounded-full"></div>
                    <div className="flex ">
                        <div className="w-8 h-8 bg-gray-300 flex justify-center items-center rounded-xl ml-5">
                            <Notification className="w-6 h-6" />
                        </div>
                        <div className="w-8 h-8 bg-gray-300 flex justify-center items-center rounded-xl">
                            <Profile className="w-6 h-6" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
